import React from 'react';
import logo from './logo.svg';
import './App.css';
import FavoriteButton from './fav-button/FavoriteButton';
import ContributionsWidget from './contribution_widget/contributions/ContributionsWidget';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Connect favorite_button to this
          <FavoriteButton size="small" color="red" />
        </p>
        <ContributionsWidget label="Add to Contributions" />
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
